var assert = require('assert');
var helper = require('./support/helper');
helper.loadSqlite3();

let elmoAb;
if (!helper.isBrowser) {
  var fs = require('fs');
  var path = require("path");
  // lots of elmo
  var elmo = fs.readFileSync(path.resolve(__dirname, './support/elmo.png'));
  elmoAb = Uint8Array.from(elmo).buffer; // Converting to an ArrayBuffer
} else {
  let ab = "";

  elmoAb = base64ToArrayBuffer(ab);
}

function base64ToArrayBuffer(base64) {
  var binary_string = atob(base64);
  var len = binary_string.length;
  var bytes = new Uint8Array(len);
  for (var i = 0; i < len; i++) {
    bytes[i] = binary_string.charCodeAt(i);
  }
  return bytes.buffer;
}

function isArrayBuffer(obj) {
  return Object.prototype.toString.call(obj) === '[object ArrayBuffer]';
}

describe('blob', function () {
  var db;
  before(async function () {
    db = await new sqlite3.Database(':memory:');
    await db.run("CREATE TABLE elmos (id INT, image BLOB)");
  });

  var total = 10;
  var inserted = 0;
  var retrieved = 0;

  if (helper.isTizen) {
    total = 1;
  }

  // NOTE: Updated to use ArrayBuffer instead of Buffer, since
  // Buffer is node.js specific
  it('+ve: should insert blobs', async () => {
    try {
      for (var i = 0; i < total; i++) {
        await db.run('INSERT INTO elmos (id, image) VALUES (?, ?)', i, elmoAb);
        inserted++;
      }
      await db.wait();
      assert.equal(inserted, total);
    } catch (err) {
      assert.ok(false);
    }
  });

  it('-ve: custom: incorrect insert to an unknown table', async () => {
    try {
      await db.run('INSERT INTO elmos1 (id, image) VALUES (?, ?)', 0, elmoAb);
      assert(false);
    } catch (err) {
      assert.equal(err.message, 'SQLITE_ERROR: no such table: elmos1');
      assert.equal(err.errno, sqlite3.ERROR);
      assert.equal(err.code, 'SQLITE_ERROR');
    }
  });

  it('+ve: should retrieve the blobs', async () => {
    try {
      let rows = await db.all('SELECT id, image FROM elmos ORDER BY id');
      for (var i = 0; i < rows.length; i++) {
        assert.ok(isArrayBuffer(rows[i].image));
        assert.ok(elmoAb.byteLength, rows[i].image.byteLength);

        for (var j = 0; j < elmoAb.byteLength; j++) {
          if (elmoAb[j] !== rows[i].image[j]) {
            assert.ok(false, "Wrong byte");
          }
        }

        retrieved++;
      }
      assert.equal(retrieved, total);
    } catch (err) {
      assert.ok(false);
    }
  });

  it('-ve: custom: incorrect all from an unknown table', async () => {
    try {
      let rows = await db.all('SELECT id, image FROM elmos1 ORDER BY id');
      assert(false);
    } catch (err) {
      assert.equal(err.message, 'SQLITE_ERROR: no such table: elmos1');
      assert.equal(err.errno, sqlite3.ERROR);
      assert.equal(err.code, 'SQLITE_ERROR');
    }
  });

  it('-ve: custom: incorrect all from an unknown column', async () => {
    try {
      let rows = await db.all('SELECT id1, image FROM elmos ORDER BY id');
      assert(false);
    } catch (err) {
      assert.equal(err.message, 'SQLITE_ERROR: no such column: id1');
      assert.equal(err.errno, sqlite3.ERROR);
      assert.equal(err.code, 'SQLITE_ERROR');
    }
  });

  it('+ve: custom: database.get()', async () => {
    try {
      let row = await db.get('SELECT id, image FROM elmos ORDER BY id');
      assert.ok(isArrayBuffer(row.image));
      assert.ok(elmoAb.byteLength, row.image.byteLength);
      for (var j = 0; j < elmoAb.byteLength; j++) {
        if (elmoAb[j] !== row.image[j]) {
          assert.ok(false, "Wrong byte");
        }
      }
    } catch (err) {
      assert.ok(false);
    }
  });

  it('-ve: custom: incorrect get from an unknown table', async () => {
    try {
      let row = await db.get('SELECT id, image FROM elmos1 ORDER BY id');
      assert(false);
    } catch (err) {
      assert.equal(err.message, 'SQLITE_ERROR: no such table: elmos1');
      assert.equal(err.errno, sqlite3.ERROR);
      assert.equal(err.code, 'SQLITE_ERROR');
    }
  });

  it('-ve: custom: incorrect get from an unknown column', async () => {
    try {
      let row = await db.get('SELECT id1, image FROM elmos ORDER BY id');
      assert(false);
    } catch (err) {
      assert.equal(err.message, 'SQLITE_ERROR: no such column: id1');
      assert.equal(err.errno, sqlite3.ERROR);
      assert.equal(err.code, 'SQLITE_ERROR');
    }
  });

  it('+ve: custom: statement.all()', async () => {
    try {
      retrieved = 0;
      let stmt = await db.prepare('SELECT id, image FROM elmos ORDER BY id');
      let rows = await stmt.all();
      for (var i = 0; i < rows.length; i++) {
        assert.ok(isArrayBuffer(rows[i].image));
        assert.ok(elmoAb.byteLength, rows[i].image.byteLength);
        for (var j = 0; j < elmoAb.byteLength; j++) {
          if (elmoAb[j] !== rows[i].image[j]) {
            assert.ok(false, "Wrong byte");
          }
        }

        retrieved++;
      }
      await stmt.finalize();
      assert.equal(retrieved, total);
    } catch (err) {
      assert.ok(false);
    }
  });

  it('-ve: custom: incorrect stmt.all() from an unknown table', async () => {
    try {
      let stmt = await db.prepare('SELECT id, image FROM elmos1 ORDER BY id');
      let rows = await stmt.all();
      assert(false);
    } catch (err) {
      assert.equal(err.message, 'SQLITE_ERROR: no such table: elmos1');
      assert.equal(err.errno, sqlite3.ERROR);
      assert.equal(err.code, 'SQLITE_ERROR');
    }
  });

  it('-ve: custom: incorrect stmt.all() from an unknown column', async () => {
    try {
      let stmt = await db.prepare('SELECT id1, image FROM elmos ORDER BY id');
      let rows = await stmt.all();
      assert(false);
    } catch (err) {
      assert.equal(err.message, 'SQLITE_ERROR: no such column: id1');
      assert.equal(err.errno, sqlite3.ERROR);
      assert.equal(err.code, 'SQLITE_ERROR');
    }
  });

  it('+ve: custom: statement.get()', async () => {
    try {
      let stmt = await db.prepare('SELECT id, image FROM elmos ORDER BY id');
      let row = await stmt.get();
      assert.ok(isArrayBuffer(row.image));
      assert.ok(elmoAb.byteLength, row.image.byteLength);
      for (var j = 0; j < elmoAb.byteLength; j++) {
        if (elmoAb[j] !== row.image[j]) {
          assert.ok(false, "Wrong byte");
        }
      }
      await stmt.finalize();
    } catch (err) {
      assert.ok(false);
    }
  });

  it('-ve: custom: incorrect stmt.get() from an unknown table', async () => {
    try {
      let stmt = await db.prepare('SELECT id, image FROM elmos1 ORDER BY id');
      let row = await stmt.get();
      assert(false);
    } catch (err) {
      assert.equal(err.message, 'SQLITE_ERROR: no such table: elmos1');
      assert.equal(err.errno, sqlite3.ERROR);
      assert.equal(err.code, 'SQLITE_ERROR');
    }
  });

  it('-ve: custom: incorrect stmt.get() from an unknown column', async () => {
    try {
      let stmt = await db.prepare('SELECT id1, image FROM elmos ORDER BY id');
      let row = await stmt.get();
      assert(false);
    } catch (err) {
      assert.equal(err.message, 'SQLITE_ERROR: no such column: id1');
      assert.equal(err.errno, sqlite3.ERROR);
      assert.equal(err.code, 'SQLITE_ERROR');
    }
  });

  after(async () => {
    await db.close();
  });
});
